window.onNotificationGCM=function(e){switch(e.event){case"registered":if(e.regid.length>0){var a=angular.element(document.querySelector("[ng-app]")),t=a.injector(),i=t.get("myService");i.registerID(e.regid,"android"),a.scope().$apply()}break;case"message":navigator.notification?navigator.notification.alert(e.payload.title):alert(e.message);break;case"error":break;default:console.log("UNKNOWN EVENT")}};